const Header = () => {
    return ( 
        <Fragment>
            <nav className="navbar navbar-light bg-secondary d-flex">
                <a className="titulo" href="#">Lenspire</a>
                <span>hola</span>
            </nav>
        </Fragment>
     );
}
 
export default Header;
